import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Obituary ()
{
    const [data, setData] = useState([])
    
    useEffect( () =>
    {
        axios.get( 'http://localhost:8081/' )
            .then( res => setData(res.data) )
            .catch( err => console.error( err ) );
    }, [] );

  return (
      <div>
          <div>
              <table>
                  <thead>
                    <th>Thumbnail</th>
                    <th>Title</th>
                    <th>Package</th>
                    <th>Status</th>
                    <th>Time</th>
                    <th>Action</th>
                  </thead>

                  <tbody>
                      { data.map( ( post, index ) =>
                      {
                          return <tr key={index}>
                              <td>{post.Thumbnail }</td>
                              <td>{post.Title }</td>
                              <td>{post.Package }</td>
                              <td>{post.Status }</td>
                              <td>{post.Time }</td>
                              <td>
                                  <button>Edit</button>
                                  <button>Delete</button>
                              </td>
                          </tr>
                      })}
                  </tbody>
              </table>
          </div>
      </div>
  )
}

export default Obituary
